//import Footer from '../Footer';

function Home () {
    return (
        <>
            <div id="aboutme">
               {/* <HeroSection/> */}
            </div>
            <div id="projects">
                {/*<Cards/>*/}
            </div>
            <div id="skills">
                {/*<SkillsSection/>*/}
            </div>
            <div id="coursework">
                {/*<CourseworkSect/>*/}
            </div>
            <div id="footer">
                {/*<Footer/>*/}
            </div>
        </>
    )
}

export default Home;
